  false,\n\t\"url\": null,\n\t\"notes\": \"A total of 136 geese were captured on Buldir.
  Of this number, 11 died in capture or transplant process. The birds that died represented
  an eight percent mortality factor for all birds captured and transplanted. Three
  birds of the eleven died after release on Amchitka. One additional adult bird escaped
  prior to transplant. 124 Aleutian Canada geese-- 96 goslings and 28 adults-- were
  successfully transplanted and released on Amchitka Island. The capture and transplant
  of wildlife Aleutian Canada geese from Buldir Island is the most efficient method
  for reestablishing nesting populations of this sub-species on islands cleared of
  foxes where the geese historically nested, prior to introduction of foxes. Eleven
  nests were found on Agattu Island proving the success of previous transplants to
  that island.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
